import React from 'react'

export default function Filters() {

    function handleClick(tag) {
        this.setState({
            activeDiv: tag
        });
    }

    return (
        <div className="page-filters">
            <div onClick={handleClick('all')} className={`filter ${this.state.activeDiv === "all" ? "active" : ""}`} data-filter="all"><span className="icon-all"></span><p>All</p></div>
            <div onClick={handleClick('new')} className={`filter ${this.state.activeDiv === "new" ? "active" : ""}`} data-filter="new"><span className="icon-new"></span><p>New</p></div>
            <div onClick={handleClick('top')} className={`filter ${this.state.activeDiv === "top" ? "active" : ""}`} data-filter="top"><span className="icon-top"></span><p>Top</p></div>
        </div>
    )
}
